fn find_position_with_aim(moves: Vec<&str>, position: Vec<i32>) -> Vec<i32> {
    const FORWARD: [&str; 1] = ["forward"];
    const INCREASE_AIM: [&str; 1] = ["down"];
    const DECREASE_AIM: [&str; 1] = ["up"];
    let mut x: i32 = position[0];
    let mut y: i32 = position[1];
    let mut aim: i32 = position[2];

    for (_index, m) in moves.iter().enumerate() {
        let splat: Vec<&str> = m.split_whitespace().collect();
        let keyword = &splat[0];
        let delta: i32 = splat[1].parse::<i32>().unwrap();

        if INCREASE_AIM.contains(keyword) {
            aim = aim + delta
        } else if DECREASE_AIM.contains(keyword) {
            aim = aim - delta
        } else if FORWARD.contains(keyword) {
            x = x + delta;
            y = y + (aim * delta)
        }
    }

    vec![x, y]
}

fn find_position(moves: Vec<&str>, position: Vec<i32>) -> Vec<i32> {
    const VERTICAL_KEYWORDS: [&str; 2] = ["up", "down"];
    const HORIZONTAL_KEYWORDS: [&str; 1] = ["forward"];
    const NEGATIVE_KEYWORDS: [&str; 1] = ["up"];
    let mut x: i32 = position[0];
    let mut y: i32 = position[1];

    for (_index, m) in moves.iter().enumerate() {
        let splat: Vec<&str> = m.split_whitespace().collect();
        let keyword = &splat[0];
        let mut delta: i32 = splat[1].parse::<i32>().unwrap();

        if NEGATIVE_KEYWORDS.contains(keyword) {
            delta = delta * -1
        }

        if VERTICAL_KEYWORDS.contains(keyword) {
            y = y + delta
        } else if HORIZONTAL_KEYWORDS.contains(keyword) {
            x = x + delta
        }
    }

    vec![x, y]
}

fn position_multiplied(position: Vec<i32>) -> i32 {
    position[0] * position[1]
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test_position_multiplied() {
        // forward 5 adds 5 to your horizontal position, a total of 5.
        // down 5 adds 5 to your depth, resulting in a value of 5.
        // forward 8 adds 8 to your horizontal position, a total of 13.
        // up 3 decreases your depth by 3, resulting in a value of 2.
        // down 8 adds 8 to your depth, resulting in a value of 10.
        // forward 2 adds 2 to your horizontal position, a total of 15.

        let moves: Vec<&str> = vec![
            "forward 5",
            "down 5",
            "forward 8",
            "up 3",
            "down 8",
            "forward 2"
        ];
        let starting_position: Vec<i32> = vec![0, 0];
        let position = find_position(moves, starting_position);

        assert_eq!(position_multiplied(position), 150);
    }

    #[test]
    fn test_position_with_aim_multiplied() {
        // forward 5 adds 5 to your horizontal position, a total of 5. Because your aim is 0, your depth does not change.
        // down 5 adds 5 to your aim, resulting in a value of 5.
        // forward 8 adds 8 to your horizontal position, a total of 13. Because your aim is 5, your depth increases by 8*5=40.
        // up 3 decreases your aim by 3, resulting in a value of 2.
        // down 8 adds 8 to your aim, resulting in a value of 10.
        // forward 2 adds 2 to your horizontal position, a total of 15. Because your aim is 10, your depth increases by 2*10=20 to a total of 60.

        let moves: Vec<&str> = vec![
            "forward 5",
            "down 5",
            "forward 8",
            "up 3",
            "down 8",
            "forward 2"
        ];
        let starting_position: Vec<i32> = vec![0, 0, 0];
        let position = find_position_with_aim(moves, starting_position);

        assert_eq!(position_multiplied(position), 900);
    }
}

